async () => {
  let position = appsmith.store.licenseKey.position;
  console.log(position);
  let data = await API_GET_AuthorizeMatrix.data;
  console.log(data);
  let filterVersion = data?.filter(item => {
    return item.version_id === appsmith.store.licenseKey.version && item.Position === position;
  });
  storeValue('authByVersion', filterVersion[0]);
  storeValue('License_By_Position', filterVersion[0]?.License);
  storeValue('Hardware_By_Position', filterVersion[0]?.Hardware);
  storeValue('Software_By_Position', filterVersion[0]?.Software);
  console.log(appsmith.store.Hardware_By_Position);
}
